function longestSubsequence(numbers: number[], func: (x: number, y: number) => boolean) {
    let dp: number[] = [];
    for (let i = 0; i < numbers.length; i++) {
        dp.push(1);
    }
    let choice: any[] = [];
    for (let i = 0; i < numbers.length; i++) {
        choice.push(undefined);
    }
    let maxIndex = 0;
    let maxValue = 1;

    for (let i = 0; i < numbers.length; i++) {
        let current = undefined;
        for (let j = i - 1; j > -1; j--) {
            if(func(numbers[i], numbers[j]) && (1 + dp[j] > dp[i])) {
                dp[i] = 1 + dp[j];
                current = j;
            }
        }
        choice[i] = current;
        if(dp[i] > maxValue) {
            maxValue = dp[i];
            maxIndex = i;
        }
    }

    let output = [];
    while (maxIndex >= 0) {
        output.unshift(numbers[maxIndex]);
        maxIndex = choice[maxIndex];
    }

    return output.join(" ");
}